import React from "react";

const FaceRecognition = () => {
    return (
        <div className="center">
            <img src={'https://image.shutterstock.com/image-photo/close-portrait-young-smiling-handsome-260nw-1180874596.jpg'} alt='picture' />
        </div>
    );
}

export default FaceRecognition;
